    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
}
contract SwapSystem is Ownable {

    modifier onlyHumans() {
    require(!isContract(msg.sender), "Contracts are not allowed");
    _;
}

     event SwapEvent(  address indexed from ,uint256 indexed BWJAmount, uint256 indexed WOJAmount );

  IERC20 public PancakeRouter;
    address public BWJ;
    address public WOJ;
     uint256 public percentP;
    IRouter02 public swapRouter;

      address[] public myPath;

    using SafeMath for uint;


   

  

     constructor() {

       
        swapRouter = IRouter02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        
        BWJ = 0x83F41c98d028842Ccc8060b4Ec7738Df3eb9a2e6;
        WOJ = 0x55F96C7005D7C684A65Ee653B07b5FE1507C56ab;
       
        percentP=0;
        myPath = new address[](3);
        myPath[0] = 0x83F41c98d028842Ccc8060b4Ec7738Df3eb9a2e6;
        myPath[1] = 0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56;
        myPath[2] = 0x55F96C7005D7C684A65Ee653B07b5FE1507C56ab;

    }
 
      function Swap(uint _amount) public  onlyHumans{

           require(msg.sender == tx.origin, "Proxy contract not allowed");
         // Make sure the contract holds enough Token A to swap
        require(IERC20(BWJ).balanceOf(msg.sender) >= _amount, "Insufficient balance");
        //get Amount Out
        uint256 amountOut = getAmountsOut(_amount);  
        //
        require(IERC20(WOJ).balanceOf(address(this)) >= amountOut, "Insufficient Contract balance");


        // Transfer Token A from the sender to the contract
        IERC20(BWJ).transferFrom(msg.sender, address(this), _amount);

        // Perform the swap (for simplicity, just transfer Token B directly to the sender)
        // getAmountsOut(_amount, []);
      
        IERC20(WOJ).transfer(msg.sender, amountOut);


        emit SwapEvent(msg.sender,_amount , amountOut);


      }

     function getAmountsOut(uint _amount)    public view returns (uint256) {
         uint256 amountOut=swapRouter.getAmountsOut(_amount, myPath)[2];
         uint256 tFee       = amountOut.mul(percentP).div(100);
          
       return amountOut + tFee;
    }



  function setPercent(uint256 _percent) public onlyOwner {
       percentP=_percent;
    }
    function withdraw() public onlyOwner {
        (bool os, ) = payable(owner()).call{value: address(this).balance}("");
        require(os);
    }
    function withdrawTokens(IERC20 token) public onlyOwner {
        uint256 balance = token.balanceOf(address(this));
        token.transfer(msg.sender, balance);
    }

function isContract(address _addr) private view returns (bool) {
    uint256 codeSize;
    assembly {
        codeSize := extcodesize(_addr)
    }
    return codeSize > 0;
}

   

}
